    [],nt"revision_timestamp": "2015-09-26T21:44:55.462269",nt"name": "offshore-wind-technology-depth-zones",nt"isopen":
    false,nt"url": null,nt"notes": "Coastal bathymetric depth, measured in
    meters at depth values of: -30, -60, -900 Shallow Zone (0-30m): Technology has been
    demonstrated on a commercial scale at these depths. Foundation types include monopile,
    gravity base and suction buckets designs. Transition Zone (30-60m): Technology has
    not been demonstrated on a commercial scale at these depths but several small scale
    projects have been successfully installed and commissioned at these depths Foundation
    types include tripod, jacket and tripile designs. Deepwater Zone (60 - 900m): Technology
    has not been demonstrated on a commercial scale at these depths but several pilot
    projects have been successfully demonstrated. Foundation types include spar, semi-submersible
    and tension leg platform designs.",nt"license_title": null,nt"extras":
